import { defineStore } from "pinia";
import AccountService from "@/services/account.service";

export const useProductData = defineStore("product", {
  //data
  state: () => {
    return {
      SearchText: "",
      dataUsers: "",
    };
  },
  actions: {
    async Login(data) {
      try {
        const s = await AccountService.loginAccount(data);
        if (s.message === "Login successful") {
          console.log(s);
          this.dataUser.dataUsers = s.user;
          console.log(this.dataUser.dataUsers);
          this.$router.push({ name: "home" });
        } else {
          this.err = true;
        }
      } catch (error) {
        console.log(error);
      }
    },
  },
});
